import Vue from 'vue'
import VueRouter from 'vue-router'
import AdminPage from "../AdminApp.vue"

Vue.use(VueRouter)  
const routes2 = [
    {
        path:'/admin',
        name:'adminPage',
        component:AdminPage
      },
      {
        path:'/admin-add',
        name:'admin-add',
        component: () => import(/* webpackChunkName: "about" */ '../views/AdminAdd.vue')
      }
  ]
const router2 = new VueRouter({
    mode: 'history',
    base: process.env.BASE_URL,
    routes2
  })


  export default router2
